import React from "react";
import "./Home.css";
import Programs from "../../component/homeComponents/programs/Programs";
import HomeSections from "../../component/homeComponents/homesection/HomeSection";



const Home = () => {
    return (
        <div className="home">
            <h1>Welcome to My Website</h1>
          <Programs/>
          <HomeSections/>
        </div>
    );
};

export default Home;
